import React from 'react'

export default function index() {

    const data = [
        {
            title: 'CS 162',
            professor: 'Brandilyn Coker'
        },
        {
            title: 'CS 271',
            professor: 'Paris Kalathas'
        }
    ]; 

  return (
    <div>
        <input style={searchbox} placeholder="Search classes or professors"/>
        <div style={searchResultParent}>
            {data.map((data) => 
            <div style={searchResult}>
                {data.title} {data.professor}
            </div>
            )}
        </div>
    </div>
  )
}

const searchbox = {
  padding: 8,
  background: '#f5f5f5',
  borderRadius: 8,
  width: 300,
  appearance: 'none',
  border: '1px solid rgb(166, 166, 166)',
}

const searchResultParent = {
    display: 'flex',
    flexDirection: 'column',
}

const searchResult = {
    background: '#f5f5f5',
    width: 300,
    borderRadius: 8
}
